import React from 'react';
import { Card, Button } from 'antd'
import Example from './example.jpg'

const { Meta } = Card;

const BookSample = () => {
	return (
		<Card 
			className="bookCard"
			cover={
				<img style={{ margin: '40px 0px 0px 0px', width: 100, height: 'auto'}} alt="example" src={Example} />}
			style={{ width: 400, display: 'flex', justifyContent: 'center', flexWrap: 'wrap'}}

		>
			<Meta 
				style={{ 
					width: 200,
					display: 'flex',
					textAlign: 'justify',
					flexDirection: 'column' 
				}}
				title="Book Name"
				description="Lorem ipsum dolor sit amet, consectetur adipiscing elit. In a feugiat orci. Ut accumsan erat at commodo tempus. In sed porta velit. Nam sed purus quis lacus ultrices interdum id suscipit ligula. Vivamus a scelerisque lacus. Ut faucibus tortor eu felis sagittis, non consectetur ex venenatis. Nullam eu mi viverra, sodales eros ac, tincidunt massa."
			/>
				<Button 
					style={{ marginTop: 20, borderRadius: 5}} 
					type="primary">See this Book
				</Button>       

		</Card>
	);
};

export default BookSample;
